    <section class="texto">
        <H1>Cursera Idiomas</H1>
        <p>Mussum Ipsum, cacilds vidis litro abertis.  
            Quem manda na minha terra sou euzis! Copo furadis 
            é disculpa de bebadis, arcu quam euismod magna. Não 
            sou faixa preta cumpadi, sou preto inteiris</p>
    </section>
